import "./App.css";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Home from "./Pages/Home";
import Favorites from "./Pages/Favorites";

function App() {
  return (
    <Router>
      <nav>
        <Link to="/"> 
        <button type="button" class="btn btn-primary btn-lg">All Users</button>
         </Link>
        <Link to="/Favorites"> <button type="button" class="btn btn-primary btn-lg">Favorites</button> </Link>
      </nav>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/Favorites" element={<Favorites />} />
        <Route path="*" element={<Home />} />
      </Routes>
    </Router>
  );
}

export default App;
